import {Fragment} from 'react';

const portalElement = document.getElementById('modal')

const ModalOverlay = (props) => {
    return (
        <div className="bg-red w-20% h-20%">
            하이
        </div>
    )
}

const Modal = (props) => {

    return (
        <Fragment>
            {ReactDOM.createPortal(<ModalOverlay>헬로우</ModalOverlay>, portalElement)}
        </Fragment>
    )
}

export default Modal;
